waves.point_eqs_str:
//sample count
sc1=sc1+1;
sc2=if(above(sc1,20),sc2+1,sc2);
sc1=if(above(sc1,20),1,sc1);
sc2=if(above(sc2,20),1,sc2);

pi=3.1415927;
tscale=2;

px=cos(pi/10*sc1)*(cos(pi/sc2*10*sin(time*.25)))*.25+(sin(time)*bass_att*bass_att*.01);
py=sin(pi/10*sc1)*(cos(pi/sc2*10*cos(time*.33)))*.25+(sin(time)*mid_att*mid_att*.01);
pz=cos(pi/sc2*7*sin(time*.1))*.1+(sin(time)*treb_att*treb_att*.01);

xrot=.05;
yrot=.07;
zrot=.12;

npx=px;
npy=py;
npz=pz;

//xrot
theta=xrot*time*tscale;
px=npx;
py=npy;
pz=npz;
npy=(py*cos(theta))+(pz*-sin(theta));
npz=(py*sin(theta))+(pz*cos(theta));

//yrot
theta=yrot*time*tscale;
px=npx;
py=npy;
pz=npz;
npx=(px*cos(theta))+(pz*sin(theta));
npz=(-px*sin(theta))+(pz*cos(theta));

//zrot
theta=zrot*time*tscale;
px=npx;
py=npy;
pz=npz;
npx=(px*cos(theta))+(py*-sin(theta));
npy=(px*sin(theta))+(py*cos(theta));

x=npx+.5;
y=(npy*1.3)+.5; //correct aspect
r=abs(sin(time*.04));
g=abs(sin(time*.111));

